from gmpy2 import is_prime
def a(n):
    t = (10**n-1)//9
    for d in range(n, 2*n):
        if is_prime(t): return t
        t = 10*t + 1
    suffix = (10**n-1)//9
    d = 2*n
    while True:
        prefix = 10**(d-n)*suffix
        for mid in range(0,10**(d-n),10**n):
            t = prefix + mid + suffix
            if is_prime(t): return t
        d += 1
